import React,{Component} from "react";
import { Nav } from 'react-bootstrap';


class Navbar extends Component {
  render(){
    return(
      <nav className="nav">
    
      
      <Nav
        activeKey="/home"
        onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
      > 
      <Nav.Item>
        <Nav.Link href="/home">Active</Nav.Link>
      </Nav.Item>
      </Nav>
    
  
    </nav>
    );  
  }
}

export default Navbar
